export const deleteSlot = (slot, babysitterId) => {
    debugger
    return dispatch => {
        return fetch(`http://localhost:3000/api/v1/babysitters/${babysitterId}/slots/${slot.id}`, {
            method: 'DELETE'
        })
            .then(response => response.json())
            .then(test => console.log("test", test))
            .then(babysitter => dispatch({ type: 'DELETE_SLOT', payload: babysitter }))



    }


}
